package org.giddap.dreamfactory.leetcode.onlinejudge;

import org.giddap.dreamfactory.leetcode.onlinejudge.implementations.Q115DistinctSubsequencesBacktrackingImpl;
import org.junit.Test;

import static org.junit.Assert.assertEquals;

public class Q115DistinctSubsequencesTest {
    private Q115DistinctSubsequences solution = new Q115DistinctSubsequencesBacktrackingImpl();

    @Test
    public void small01() {
        assertEquals(3, solution.numDistinct("rabbbit", "rabbit"));
    }

    @Test
    public void small02() {
        assertEquals(1, solution.numDistinct("abcde", "ace"));
    }

    @Test
    public void small03() {
        assertEquals(3, solution.numDistinct("ccc", "c"));
    }

    @Test
    public void small04() {
        assertEquals(20, solution.numDistinct("acaaaacbcbcccabbabccc", "caa"));
    }

    @Test
    public void large01() {
        assertEquals(1293119,
                solution.numDistinct("eacabdeadcbbddccdaccadddbaaebadcbaaedeeebdabbaeccdbcbaceaceddcdbddadecebaacdcdaeeccaebaeebceaaaaaceaedd", "baaacbceabba"));
    }


    @Test
    public void large02() {
        assertEquals(10582116,
                solution.numDistinct("aabdbaabeeadcbbdedacbbeecbabebaeeecaeabaedadcbdbcdaabebdadbbaeabdadeaabbabbecebbebcaddaacccebeaeedababedeacdeaaaeeaecbe", "bddabdcae"));
    }
}

